import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './ResultsPage.css';

const DetectionBox = React.memo(({ detection, index }) => {
  if (!detection?.bbox) return null;

  const confidence = detection.confidence || 0;
  const name = detection.feature_name || detection.class_name || 'Unknown';
  const [x1, y1, x2, y2] = detection.bbox;
  
  const style = {
    position: 'absolute',
    left: `${x1 * 100}%`,
    top: `${y1 * 100}%`,
    width: `${(x2 - x1) * 100}%`,
    height: `${(y2 - y1) * 100}%`,
    zIndex: detection.type === 'peso' ? 10 : 20 + index,
  };
  
  return (
    <div 
      className={`detection-box ${detection.color_class || ''}`}
      style={style}
      title={`${name} (${(confidence * 100).toFixed(1)}%)`}
    >
      <div className="feature-label">{name}</div>
      <div className="confidence-badge">{(confidence * 100).toFixed(0)}%</div>
    </div>
  );
});

const ResultsPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  
  const { result, imageUrl } = location.state || {};

  if (!result) {
    navigate('/scan');
    return null;
  }

  const pesoDetection = result.peso_detection || {};
  const isAuthentic = pesoDetection.authentic;
  const confidence = Math.round((pesoDetection.confidence || 0) * 100);
  const denomination = pesoDetection.denomination || 'Unknown';

  const handleSaveToHistory = () => {
    const existingHistory = JSON.parse(localStorage.getItem('pesoscan_history') || '[]');
    const scanRecord = {
      id: Date.now().toString(),
      timestamp: new Date().toISOString(),
      result,
      imageUrl
    };
    existingHistory.unshift(scanRecord);
    localStorage.setItem('pesoscan_history', JSON.stringify(existingHistory.slice(0, 50)));
    alert('Scan saved to history!');
  };

  const detections = [
    ...(result.result?.peso_features || []).map(f => ({
      ...f,
      type: 'peso',
      color_class: 'peso-detection'
    })),
    ...(result.result?.security_features || []).map((f, i) => ({
      ...f,
      type: 'security', 
      color_class: `security-feature-${i % 6}`
    }))
  ].filter(d => d.bbox?.length >= 4)
   .sort((a, b) => (b.confidence || 0) - (a.confidence || 0))
   .slice(0, 8);

  return (
    <div className="results-page">
      <div className="content">
        <h2>Scan Results</h2>
        
        <div className="image-section">
          <div className="image-container">
            <img src={imageUrl} alt="Analyzed banknote" />
            <div className="detections">
              {detections.map((detection, index) => (
                <DetectionBox
                  key={`${detection.type}-${index}`}
                  detection={detection}
                  index={index}
                />
              ))}
            </div>
          </div>
        </div>

        <div className="status-section">
          <div className={`status ${isAuthentic ? 'authentic' : 'counterfeit'}`}>
            <div className="icon">
              {isAuthentic ? (
                <svg width="32" height="32" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M9 12l2 2 4-4" stroke="currentColor" strokeWidth="3" strokeLinecap="round" strokeLinejoin="round"/>
                  <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2" fill="none"/>
                </svg>
              ) : (
                <svg width="32" height="32" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2" fill="none"/>
                  <line x1="15" y1="9" x2="9" y2="15" stroke="currentColor" strokeWidth="3"/>
                  <line x1="9" y1="9" x2="15" y2="15" stroke="currentColor" strokeWidth="3"/>
                </svg>
              )}
            </div>
            <div className="text">{isAuthentic ? 'Authentic' : 'Counterfeit'}</div>
            <div className="confidence">{confidence}% Confidence</div>
            {denomination && <div className="denomination">â‚±{denomination}</div>}
          </div>
        </div>

        <div className="actions">
          <button onClick={() => navigate('/scan')} className="btn scan">
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M23 19a2 2 0 0 1-2 2H3a2 2 0 0 1-2-2V8a2 2 0 0 1 2-2h4l2-3h6l2 3h4a2 2 0 0 1 2 2z" stroke="currentColor" strokeWidth="2" fill="none"/>
              <circle cx="12" cy="13" r="4" stroke="currentColor" strokeWidth="2" fill="none"/>
            </svg>
            Scan Another Banknote
          </button>
          
          <button onClick={handleSaveToHistory} className="btn save">
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M19 21l-7-5-7 5V5a2 2 0 0 1 2-2h10a2 2 0 0 1 2 2z" stroke="currentColor" strokeWidth="2" fill="none"/>
            </svg>
            Save to History
          </button>
        </div>
      </div>
    </div>
  );
};

export default ResultsPage;
